    ar: "Loading...",
    hy: "ՍԵՐՎԵՐԻ ՍԽԱԼ. Ձեր ուսումնասիրությունը կարծես անհասանելի է (404) Պավլովիայի սերվերում: Կան մի քանի եղանակներ, որոնցով դա կարող է տեղի ունենալ: Ահա թե ինչպես կարելի է շտկել խնդիրը.\n1. Դա կարող էր ակնթարթային խնդիր լինել, հիմա չկա: Թերևս Պավլովիան դանդաղ էր ուսումնասիրությունը հասանելի դարձնելու հարցում, կամ ժամանակավոր անջատում է տեղի ունեցել սերվերի բարձր տրաֆիկի պատճառով: Փորձեք թարմացնել ուսումնասիրության էջը՝ սեղմելով թարմացման կոճակը ↻ ձեր դիտարկիչի հասցեագոտում: Դուք կարող եք փորձել ավելի քան մեկ անգամ: Եթե ​​այն հասանելի դառնա, ձեր ուսումնասիրությունը կանցնի նորմալ:\n2. Եթե դա չհաջողվի, EasyEyes կոմպիլյատորի էջում սեղմեք «Գնալ դեպի Պավլովիա» կոճակը (էջի ներքևի աջ կողմը)՝ ձեր ուսումնասիրության համար Պավլովիայի վահանակը բացելու համար:\n3. Պավլովիայի վահանակում համոզվեք, որ ձեր ուսումնասիրությունը «ԳՈՐԾՈՒՄ» ռեժիմում է: Եթե ​​այն ԱՆԱԿՏԻՎ է, ապա սեղմեք RUNNING կոճակը: Երկու վայրկյանից ձեր ուսումնասիրությունը կանցնի RUNNING ռեժիմի և այժմ կարող է նորմալ աշխատել: Վերադարձեք EasyEyes կոմպիլյատորի էջ և սեղմեք RUN կամ օգտագործեք ուսումնասիրության URL-ը:\n4. Եթե ձեր անհասանելի ուսումնասիրությունն արդեն RUNNING ռեժիմում է, դա սովորաբար ցույց է տալիս, որ ձեր ուսումնասիրությունը չունի վարկային/լիցենզիա առցանց թեստավորման համար վճարելու համար: Շարունակելու երեք եղանակ կա.\n5. ՊԻԼՈՏ ԱՆՎՃԱՐ ՊԱՎԼՈՎԻԱ ԴԱՇՏԱԴԻՑ: Եթե ​​ցանկանում եք, կարող եք սեղմել «PILOTING» կոճակը Պավլովիայի վահանակում՝ ձեր ուսումնասիրությունը PILOTING ռեժիմի մեջ դնելու համար: Գործարկեք ձեր ուսումնասիրությունը՝ սեղմելով PILOT կոճակը (Պավլովիայի վահանակում): Դա անվճար է, բայց ձեր ուսումնասիրության URL-ը մնում է անհասանելի:\n6. ԳՈՐԾԵԼ ՕՆԼԱՅՆ ԱՊԱՌԻԿ. Առցանց գործարկելու համար նույն վահանակում կարող եք վարկեր գնել Պավլովիայից և մի քանիսը հատկացնել այս ուսումնասիրությանը: Դա թույլ կտա այս ուսումնասիրությունը իրականացնել առցանց:\n7. ՎԱԶԵԼ ՕՆԼԱՅՆ ԼԻՑԵՆԶԻԱՅԻ ՀԵՏ. EasyEyes-ն ունի կայքի լիցենզիա Պավլովիայի համար: Գրեք denis.pelli@nyu.edu հասցեին և խնդրեք, որ ձեր էլփոստը ներառվի EasyEyes Pavlovia կայքի լիցենզիայում: (Կամ, եթե ձեր հաստատությունն ունի Պավլովիայի կայքի լիցենզիա, կարող եք դրա փոխարեն օգտագործել:) Տրամադրեք ձեր էլ. հասցեն Պավլովիայի վահանակին՝ ցույց տալու համար, որ լիցենզավորված եք, ինչը Պավլովիան կհիշի ապագա նիստերում: Սա թույլ է տալիս ձեր բոլոր ուսումնասիրությունները առցանց անցկացնել:",
