    nl: 'SERVERFOUT. Uw onderzoek lijkt niet beschikbaar (404) te zijn op de Pavlovia-server. Dit kan op verschillende manieren gebeuren. Zo kunt u het probleem oplossen:\n1. Het was mogelijk een tijdelijk probleem dat nu is opgelost. Mogelijk was Pavlovia traag met het beschikbaar stellen van het onderzoek, of was er een tijdelijke storing door veel serververkeer. Probeer de onderzoekspagina te vernieuwen door op de knop Vernieuwen ↻ in de adresbalk van uw browser te klikken. U kunt het meerdere keren proberen. Als de pagina beschikbaar is, wordt uw onderzoek normaal uitgevoerd.\n2. Als dat niet lukt, klikt u op de EasyEyes-compilerpagina op de knop "Ga naar Pavlovia" (rechtsonder op de pagina) om het Pavlovia-dashboard voor uw onderzoek te openen.\n3. Zorg ervoor dat uw onderzoek in het Pavlovia-dashboard in de modus "RUNNING" staat. Als deze INACTIEF is, druk dan op de knop RUNNING. Binnen twee seconden schakelt uw onderzoek over naar de modus RUNNING en kan het weer normaal worden uitgevoerd. Ga terug naar de EasyEyes-compilerpagina en klik op UITVOEREN of gebruik de URL van de studie.\n4. Als uw niet-beschikbare studie al in de RUNNING-modus staat, betekent dit meestal dat uw studie niet over voldoende credits/licenties beschikt om online tests te betalen. Er zijn drie manieren om verder te gaan.\n5. GRATIS PILOT VIA HET PAVLOVIA-DASHBOARD. Als u wilt, kunt u op de PILOT-knop in het Pavlovia-dashboard klikken om uw studie in de PILOT-modus te zetten. Voer uw studie uit door op de PILOT-knop te drukken (in het Pavlovia-dashboard). Dat is gratis, maar uw studie-URL blijft onbeschikbaar.\n6. ONLINE UITVOEREN MET CREDIT. Om online uit te voeren, kunt u in hetzelfde dashboard credits kopen bij Pavlovia en deze toewijzen aan deze studie. Hierdoor kan deze studie online worden uitgevoerd.\n7. ONLINE UITVOEREN MET LICENTIE. EasyEyes heeft een sitelicentie voor Pavlovia. Stuur een e-mail naar denis.pelli@nyu.edu en vraag of je e-mailadres kan worden opgenomen in de EasyEyes Pavlovia-sitelicentie. (Of, als je instelling een Pavlovia-sitelicentie heeft, kun je die gebruiken.) Geef je e-mailadres door aan het Pavlovia-dashboard om aan te tonen dat je een licentie hebt. Pavlovia onthoudt dit adres dan in toekomstige sessies. Zo kun je al je studies online volgen.',
