    bg: "Loading...",
    "zh-CN": "Loading...",
    "zh-HK": "Loading...",
    hr: "Loading...",
    cs: "Tato studie potřebuje anonymní/soukromé okno, ale toto okno není. Můžete to opravit. Pomocí libovolného jiného prohlížeče než Safari otevřete anonymní okno a v tomto okně spusťte odkaz na studii. \n \n VYSVĚTLENÍ: Všechny hlavní prohlížeče umožňují otevřít okno v režimu inkognito, i když název se liší, např. „Inkognito“, „InPrivate“, „Soukromé procházení“ nebo „Soukromé okno“. Všechny prohlížeče kromě Safari hlásí, zda je webová stránka v anonymním režimu. Safari vždy říká ne. Anonymní režim se obvykle používá pro ochranu soukromí. EasyEyes jej používá pro usnadnění přístupu ke knihovně EasyEyes Firebase, která je potřebná pro kalibraci zvuku.",
    da: "Loading...",
    nl: "Loading...",
    "en-UK":
      "This study requires an incognito/private window, and this window isn't. You can fix this. Using any browser other than Safari, open an incognito window, and run the study link in that window.\n\nEXPLANATION: All major browsers allow you to open a window in incognito mode, though the name varies, e.g. “Incognito”, “InPrivate”, “Private Browsing”, or “Private Window”. All browsers except Safari report whether the web page is in incognito mode. Safari always says no. Incognito mode is typically used for privacy. EasyEyes uses it to ease access to the EasyEyes Firebase library, which is needed for sound calibration.",
    fi: "Loading...",
    fr: 'Cette étude nécessite une fenêtre incognito/privée, et cette fenêtre ne l\'est pas. Vous pouvez corriger cela. En utilisant un navigateur autre que Safari, ouvrez une fenêtre incognito et exécutez le lien de l\'étude dans cette fenêtre.\n\nEXPLICATION : Tous les principaux navigateurs vous permettent d\'ouvrir une fenêtre en mode incognito, bien que le nom varie, par exemple "Incognito", "InPrivate", "Navigation privée" ou "Fenêtre privée". Tous les navigateurs sauf Safari indiquent si la page web est en mode incognito. Safari dit toujours non. Le mode incognito est généralement utilisé pour la confidentialité. EasyEyes l\'utilise pour faciliter l\'accès à la bibliothèque Firebase d\'EasyEyes, qui est nécessaire pour l\'étalonnage du son.',
    de: "Loading...",
    el: "Loading...",
    he: "Loading...",
    hi: "Loading...",
    hu: "Loading...",
    is: "Loading...",
    id: 'Studi ini memerlukan jendela penyamaran/pribadi, dan jendela ini tidak memerlukannya. Anda dapat memperbaikinya. Dengan menggunakan peramban apa pun selain Safari, buka jendela penyamaran, dan jalankan tautan studi di jendela tersebut. \n\nPENJELASAN: Semua peramban utama memungkinkan Anda untuk membuka jendela dalam mode penyamaran, meskipun namanya bervariasi, misalnya "Incognito", "InPrivate", "Private Browsing", atau "Private Window". Semua peramban kecuali Safari melaporkan apakah halaman web dalam mode penyamaran. Safari selalu mengatakan tidak. Mode penyamaran biasanya digunakan untuk privasi. EasyEyes menggunakannya untuk memudahkan akses ke pustaka EasyEyes Firebase, yang diperlukan untuk kalibrasi suara.',
    it: 'Questo studio richiede una finestra in incognito/privata, e questa finestra non lo è. Puoi risolvere questo problema. Usando un browser diverso da Safari, apri una finestra in incognito e esegui il link dello studio in quella finestra.\n\nSPIEGAZIONE: Tutti i principali browser ti permettono di aprire una finestra in modalità incognito, anche se il nome varia, ad esempio "Incognito", "InPrivate", "Navigazione Privata" o "Finestra Privata". Tutti i browser tranne Safari segnalano se la pagina web è in modalità incognito. Safari dice sempre di no. La modalità incognito è tipicamente utilizzata per la privacy. EasyEyes la utilizza per facilitare l\'accesso alla libreria Firebase di EasyEyes, necessaria per la calibrazione del suono.',
