    es: 'TU iPhone. Necesitamos dos detalles que especifiquen el modelo de tu iPhone. En el teléfono, ve a Configuración > General > Acerca de.\n\n1. NOMBRE DEL MODELO. Si está ejecutando iOS 12.2 o posterior, copia el Nombre del Modelo en el campo de abajo. Si está ejecutando una versión anterior de iOS, consulta el ÚLTIMO RECURSO a continuación.\n\n2. NÚMERO "A" OCULTO. Si estás ejecutando iOS 10 o posterior, al tocar el Número de Modelo se revelará el número "A" oculto: una "A" seguida de cuatro dígitos, como A1234. Copia el número A en el campo de abajo. Si es un iPhone 8 o posterior, con una bandeja SIM, retira la bandeja SIM y busca el número A en la ranura. Si no hay bandeja SIM, busca el número A en el conector Lightning o USB-C. Asegúrate de estar en un lugar con luz brillante sobre tu cabeza. El número A está en el lado superior, el lado con la pantalla. Copia el número A en el campo de abajo. Si el iPhone es anterior al iPhone 8, el número A está impreso en la parte trasera como algo similar a "Modelo A1234". Copia el número A en el campo de abajo.\n\nÚLTIMO RECURSO. Si tienes ChatGPT o equivalente, copia el Número de Modelo del iPhone, por ejemplo, MD298HB/A, de su página Acerca de y pregunta a ChatGPT por su nombre de modelo y número A.',
