    es: "1. SELECCIONAR MICRÓFONO USB. Conecta el cable USB-C de tu micrófono a esta computadora. Abre el panel de control de audio de la computadora.  \n      Macintosh: Configuración del sistema > Sonido  \n     ⊞ Windows: Configuración > Sonido > Panel de control de sonido  \nSelecciona tu micrófono como la entrada.  \n\n2. SELECCIONAR FRECUENCIA DE MUESTREO. El UMIK-1 ofrece solo una frecuencia de muestreo y bits/muestra, por lo que no hay nada que configurar. El UMIK-2 ofrece varias, que debes configurar usando una aplicación o panel de control:  \n      Macintosh: Configuración de Audio MIDI de Apple.app en la carpeta Aplicaciones/Utilidades.  \n     ⊞ Windows: Panel de control > Hardware y sonido > Administrar dispositivos de audio  \nConfigura el UMIK-2 para muestrear a 111 Hz con 222 bits/muestra. (Puedes cambiar esta preferencia configurando _calibrateSoundSamplingDesiredHz y _calibrateSoundSamplingDesiredBits en la hoja de cálculo de tu estudio.)",
