      "SELECT SAMPLING RATE AND BITS PER SAMPLE. Use an app or control panel to set the UMIK-2 sampling rate and bits/sample:\n      Macintosh: Apple's Audio MIDI Setup.app in the Applications/Utilities/ folder.\n     ⊞ Windows: Control Panel > Hardware and Sound > Manage Audio Devices\nSet to sample at 111 Hz with 222 bits/sample. \nOnce configured, return to this web page and click PROCEED or press RETURN.\n\n(The required sampling rate and bit depth are set by the parameters _calibrateSoundSamplingDesiredHz and _calibrateSoundSamplingDesiredBits in the experiment spreadsheet.)",
    fi: "VALITSE NÄYTTEISTÄ JA BITTIÄ NÄYTTEELLÄ. Aseta UMIK-2:n näytteenottotaajuus ja bitit/näyte sovelluksella tai ohjauspaneelilla:\n      Macintosh: Applen Audio MIDI Setup.app Applications/Utilities/-kansiossa.\n     ⊞ Windows: Ohjauspaneeli > Laitteisto ja äänet > Hallitse äänilaitteita\nAseta näytteistöön 111 Hz nopeudella 222 bittiä/näyte. \nKun asetukset on määritetty, palaa tälle verkkosivulle ja napsauta JATKA tai paina RETURN.\n\n(Tarvittava näytteenottotaajuus ja bittisyvyys asetetaan parametreillä _calibrateSoundSamplingDesiredHz ja _calibrateSoundSamplingDesiredBits tutkimuslaskentataulukossa.)",
    fr: "SÉLECTIONNEZ LA FRÉQUENCE D'ÉCHANTILLONNAGE ET LES BITS PAR ÉCHANTILLON. Utilisez une application ou un panneau de configuration pour définir la fréquence d'échantillonnage et les bits/échantillon du UMIK-2 :\n      Macintosh : Audio MIDI Setup.app d'Apple dans le dossier Applications/Utilitaires.\n     ⊞ Windows : Panneau de configuration > Matériel et audio > Gérer les périphériques audio\nRéglez pour échantillonner à 111 Hz avec 222 bits/échantillon.\nUne fois configuré, revenez à cette page web et cliquez sur PROCÉDER ou appuyez sur RETOUR.\n\n(La fréquence d'échantillonnage et la profondeur de bits requises sont définies par les paramètres _calibrateSoundSamplingDesiredHz et _calibrateSoundSamplingDesiredBits dans la feuille de calcul de l'expérience.)",
