    is: "VELDU SÝNISTAFN OG BITA Á SÝNIS. Notaðu app eða stjórnborð til að stilla UMIK-2 sýnatökuhraða og bita/sýni:\n      Macintosh: Apple Audio MIDI Setup.app í Applications/Utilities/ möppunni.\n     ⊞ Windows: Stjórnborð > Vélbúnaður og hljóð > Stjórna hljóðtækjum\nStillt á sýnishorn á 111 Hz með 222 bitum/sýni. \nÞegar það hefur verið stillt skaltu fara aftur á þessa vefsíðu og smella á ÁFRAM eða ýta á TILBAKA.\n\n(Tilskilið sýnatökuhraði og bitadýpt eru stillt með færibreytunum _calibrateSoundSamplingDesiredHz og _calibrateSoundSamplingDesiredBits í rannsóknartöflureikninum.)",
