    "zh-CN":
      "1. 这台电脑有 111 个摄像头。\n2. 这项研究会追踪视线或观看距离，因此需要在屏幕顶部边缘安装一个摄像头，因此请选择带有顶部边缘摄像头的屏幕。\n3. 请将此窗口拖动到您想要用于此研究的屏幕上。\n4. 大部分内容在该屏幕上即可。\n5. 然后点击“继续”或按“返回”。",
