    ml: "1. ഈ കമ്പ്യൂട്ടറിൽ 111 ക്യാമറ(കൾ) ഉണ്ട്. \n2. ഈ പഠനം നോട്ടം അല്ലെങ്കിൽ കാഴ്ച ദൂരം ട്രാക്ക് ചെയ്യുന്നു, അതിന് സ്ക്രീനിൻ്റെ മുകൾ ഭാഗത്ത് ഒരു ക്യാമറ ആവശ്യമാണ്, അതിനാൽ ദയവായി ഒരു ടോപ്പ് എഡ്ജ് ക്യാമറയുള്ള ഒരു സ്ക്രീൻ തിരഞ്ഞെടുക്കുക. \n3. ഈ പഠനത്തിനായി നിങ്ങൾ ഉപയോഗിക്കാൻ ആഗ്രഹിക്കുന്ന സ്ക്രീനിലേക്ക് ഈ വിൻഡോ വലിച്ചിടുക.\n4. മിക്കവാറും ആ സ്‌ക്രീനിൽ ഉണ്ടായാൽ മതി.\n5. തുടർന്ന് PROCEED ക്ലിക്ക് ചെയ്യുക അല്ലെങ്കിൽ RETURN അമർത്തുക.",
