    pt: "Loading...",
    ro: "1. Găsiți camera web. Este de obicei în partea centrală sus a acestui ecran ↑ și poate avea o lumină albă sau verde.\n2. În următorii pași, vă veți plasa pentru scurt timp ochiul la o distanță cunoscută de camera web și îi veți cere să înregistreze distanța.\n3. Veți avea nevoie de un obiect lung mai mic decât acest ecran. Mai lung este mai bine (și mai confortabil), până la maximul arătat de linia orizontală de mai jos.\n4. Obiectul poate fi orice cu o lungime potrivită: poate o carte, o bucată de hârtie, o sticlă de apă sau un smartphone. Evitați obiectele dure înguste, cum ar fi un creion, care vă pot răni ochiul.\n5. Puteți chiar să vă folosiți mâna 🖐. Întinde degetele cât mai mult posibil și măsoară de la vârful micului până la vârful degetului mare.\n6. Țineți ușor obiectul de ecran, astfel încât lungimea acestuia să fie orizontală.\n7. Așezați marginea din stânga a obiectului la linia verde verticală STÂNGA.\n8. Folosiți cursorul sau tastele săgeată ◀ ▶ pentru a muta linia verde DREAPTA la marginea dreaptă a obiectului.\n9. Acum ridicați obiectul și utilizați-l pentru a măsura distanța de la camera web la ochi.\n10. Înclinați-vă spre camera web până când distanța de la camera web la ochi se potrivește cu lungimea obiectului.\n11. Ținând capul fix, scoateți obiectul, astfel încât camera web să aibă o vedere clară a feței dumneavoastră.\n12. Ținând în continuare capul fix, apăsați RETURN sau faceți clic pe PROCEED pentru a înregistra poziția și a continua.",
    ru: "Loading...",
    sr: "1. Пронађите своју веб камеру. Обично је у горњем центру овог екрана ↑ и може имати бело или зелено светло.\n2. У следећим корацима, накратко ћете поставити око на познато растојање од веб камере и замолити га да забележи удаљеност.\n3. Требаће вам дугачак објекат мањи од овог екрана. Дуже је боље (и удобније), до максимума приказаног хоризонталном линијом испод.\n4. Предмет може бити било шта одговарајуће дужине: можда књига, комад папира, флаша за воду или паметни телефон. Избегавајте тврде уске предмете, попут оловке, који могу да повреде ваше око.\n5. Можете чак и да користите своју руку 🖐. Испружите прсте што је више могуће и измерите од врха малог прста до врха палца.\n6. Нежно држите објекат уз екран, тако да његова дужина буде хоризонтална.\n7. Поставите леву ивицу објекта на ЛЕВУ вертикалну зелену линију.\n8. Користите курсор или тастере са стрелицама ◀ ▶ да померите ДЕСНУ зелену линију на десну ивицу објекта.\n9. Сада подигните предмет и користите га да измерите растојање од веб камере до ока.\n10. Нагните се ка веб камери док растојање од веб камере до вашег ока не одговара дужини објекта.\n11. Држећи главу фиксираном, уклоните предмет тако да веб камера има јасан поглед на ваше лице.\n12. И даље држећи главу фиксираном, притисните РЕТУРН или кликните НАСТАВИ да снимите позицију и наставите.",
