    nl: "1. Gebruik een liniaal of meetlint om de afstand te meten van het midden van je scherm tot de voorkant van een van je ogen (beide ogen zijn prima). Als je een bril draagt, negeer deze dan tijdens het meten.\n2. Leun naar voren of naar achteren, of verplaats je stoel of dit scherm, totdat de afstand 111 AAA is. De vereiste afstand wordt altijd groot weergegeven aan de rechterkant van dit scherm, leesbaar vanaf elke afstand.\n3. ALS HET TE VER IS, OVERSLAAN. Als je niet zo ver weg kunt komen, sla deze stap dan over door ❌ op het toetsenbord of X op het toetsenbord te typen.\n4. Zodra je de juiste afstand hebt bereikt, houd je hoofd stil en leg je de liniaal opzij om ervoor te zorgen dat de camera je hele gezicht vrij kan zien.\n5. Druk of tik op RETURN op je toetsenbord of het toetsenblok van je telefoonscherm om verder te gaan.\n6. De voortgangsteller hieronder schuift naar rechts en de volgende afstand verschijnt. Ga naar stap 1 hierboven. Elke afstand heeft dezelfde instructies, alleen de afstand verandert.\nLET OP: Als het toetsenbord van de telefoon niet meer reageert, vernieuw het dan door op de adresbalk van de telefoon te tikken en op 'Ga' te tikken.",
