    ru: "1. Используйте линейку или рулетку, чтобы измерить расстояние от центра экрана до передней части одного из ваших глаз (любой глаз в порядке). Если вы носите очки, игнорируйте их во время измерения.\n2. Наклонитесь вперед или назад или отодвиньте стул или этот экран, пока расстояние не станет 111 AAA. Требуемое расстояние всегда отображается крупным шрифтом в правой части этого экрана, его можно прочитать с любого расстояния.\n3. ЕСЛИ ОНО СЛИШКОМ ДАЛЕКО, ПРОПУСТИТЕ ЕГО. Если вы не можете отойти так далеко, то пропустите этот шаг, нажав ❌ на клавиатуре или X на клавиатуре.\n4. Когда вы окажетесь на нужном расстоянии, держите голову ровно и отложите линейку в сторону, чтобы убедиться, что камера имеет беспрепятственный обзор всего вашего лица.\n5. Нажмите или коснитесь RETURN на клавиатуре или клавиатуре экрана телефона, чтобы продолжить.\n6. Счетчик хода выполнения ниже сдвинется вправо, и появится следующее расстояние. Перейдите к шагу 1 выше. Для каждого расстояния действуют одни и те же инструкции, меняется только расстояние. ПРИМЕЧАНИЕ. Если клавиатура телефона перестанет отвечать, обновите ее, нажав на адресную строку телефона и нажав «go».",
    sr: "Loading...",
    es: '1. Usa una regla o cinta métrica para medir la distancia desde el centro de tu pantalla hasta el frente de uno de tus ojos (cualquiera de los dos está bien). Si usas gafas, ignóralas mientras mides. \n2. Inclínate hacia adelante o hacia atrás, o mueve tu silla o esta pantalla, hasta que la distancia sea de 111 AAA. La distancia requerida siempre se muestra en grande en el lado derecho de esta pantalla, legible desde cualquier distancia. \n3. SI ESTÁ DEMASIADO LEJOS, SÁLTALO. Si no puedes alejarte tanto, entonces omite este paso escribiendo ❌ en el teclado numérico o X en el teclado. \n4. Una vez que estés a la distancia correcta, mantén la cabeza firme y deja la regla a un lado para asegurar que la cámara tenga una vista despejada de toda tu cara. \n5. Presiona o toca RETURN en el teclado de tu computadora o en el teclado de la pantalla del teléfono para continuar. \n6. El contador de progreso abajo se deslizará hacia la derecha, y aparecerá la siguiente distancia. Ve al paso 1, arriba. Cada distancia tiene las mismas instrucciones, solo cambia la distancia. \nNOTA: Si el teclado del teléfono alguna vez se vuelve no responsivo, actualízalo tocando la barra de direcciones del teléfono y tocando "ir".',
