    ar: "1. قم بقياس عرض وارتفاع الشاشة المضيئة بالسنتيمترات.\n2. قم بقياس كل هامش — الأيسر، الأيمن، العلوي، والسفلي — من حافة الشاشة إلى الحافة الفعلية للشاشة.\n3. قم بقياس الارتفاع من الطاولة إلى الحافة السفلية للشاشة. هذه هي الحافة السفلية للهامش.",
    hy: "Loading...",
