    "zh-CN": "Loading...",
    "zh-HK": "Loading...",
    hr: "Loading...",
    cs: "1. Změřte v centimetrech šířku a výšku zářící obrazovky.\n2. Změřte každý okraj – levý, pravý, horní a dolní – od okraje obrazovky k fyzickému okraji monitoru.\n3. Změřte výšku od stolu ke spodnímu okraji monitoru. To je spodní okraj okraje.",
    da: "Loading...",
