  RC_gazeTrackingIntro: {
    "en-US":
      'PLAY "CATCH THE CROSS!" Now we’ll set up gaze tracking, to monitor eye position. Keep your face in the video feed (see below). Click on the center of the cross, wherever it is. Make sure that your eyes are on it when you click it. When you click it, the cross will move to a new location. Click it in each new location, until the calibration is done. It\'s a game. Catch the cross!',
    ar: 'العب "امسك الصليب!" الآن سنقوم بإعداد تتبع النظرات لمراقبة وضع العين. حافظ على وجهك في الفيديو (انظر أدناه). انقر على مركز الصليب أينما كان. تأكد من أن عينيك عليه عندما تنقر عليه. عندما تنقر عليه، سينتقل الصليب إلى موقع جديد. انقر عليه في كل موقع جديد حتى يتم الانتهاء من المعايرة. إنها لعبة. امسك الصليب!',
    hy: "Loading...",
    bg: "Loading...",
    "zh-CN": "Loading...",
    "zh-HK": "Loading...",
    hr: "Loading...",
    cs: "Loading...",
    da: "Loading...",
    nl: "Loading...",
    "en-UK":
      'PLAY "CATCH THE CROSS!" Now we’ll set up gaze tracking, to monitor eye position. Keep your face in the video feed (see below). Click on the centre of the cross, wherever it is. Make sure that your eyes are on it when you click it. When you click it, the cross will move to a new location. Click it in each new location, until the calibration is done. It\'s a game. Catch the cross!',
    fi: "Loading...",
    fr: "JOUER \"ATTRAPEZ LA CROIX !\" Nous allons maintenant configurer le suivi du regard, pour surveiller la position des yeux. Gardez votre visage dans le flux vidéo (voir ci-dessous). Cliquez sur le centre de la croix, où qu'elle soit. Assurez-vous que vos yeux sont dessus lorsque vous cliquez. Lorsque vous cliquez, la croix se déplacera vers un nouvel emplacement. Cliquez dessus à chaque nouvel emplacement, jusqu'à ce que l'étalonnage soit terminé. C'est un jeu. Attrapez la croix !",
    de: "Loading...",
    el: "Loading...",
    he: "Loading...",
    hi: '"क्रॉस को पकड़ो!" खेलें अब हम आंखों की स्थिति पर नज़र रखने के लिए गेज ट्रैकिंग सेट अप करेंगे। अपना चेहरा वीडियो फ़ीड में रखें (नीचे देखें)। क्रॉस के केंद्र पर क्लिक करें, चाहे वह कहीं भी हो। सुनिश्चित करें कि जब आप इसे क्लिक करें तो आपकी नज़र उस पर हो। जब आप इसे क्लिक करेंगे, तो क्रॉस एक नए स्थान पर चला जाएगा। कैलिब्रेशन पूरा होने तक, प्रत्येक नए स्थान पर इसे क्लिक करें। यह एक खेल है। क्रॉस को पकड़ो!',
    hu: "Loading...",
    is: "Loading...",
    id: "Loading...",
    it: 'GIOCA "CATTURA LA CROCE!" Ora imposteremo il tracciamento dello sguardo, per monitorare la posizione degli occhi. Tieni il viso nel video (vedi sotto). Clicca al centro della croce, ovunque si trovi. Assicurati che i tuoi occhi siano su di essa quando la clicchi. Quando la clicchi, la croce si sposterà in una nuova posizione. Cliccala in ogni nuova posizione, fino a quando la calibrazione è completata. È un gioco. Cattura la croce!',
    ja: "Loading...",
    kn: "Loading...",
    ko: "Loading...",
    lt: "ŽAISKITE „CATCH THE CROSS“! Dabar nustatysime žvilgsnio sekimą, kad galėtume stebėti akių padėtį. Laikykite savo veidą vaizdo įrašų sklaidos kanale (žr. toliau). Spustelėkite kryžiaus centrą, kad ir kur jis būtų. Įsitikinkite, kad spustelėdami jį nukreipėte akis. Kai spustelėsite jį, kryžius persikels į naują vietą. Spustelėkite jį kiekvienoje naujoje vietoje, kol bus atliktas kalibravimas. Tai žaidimas. Pagauk kryžių!",
    ms: "Loading...",
    ml: "Loading...",
    no: "Loading...",
    fa: "Loading...",
    pl: "Loading...",
    pt: "Loading...",
    ro: "Loading...",
    ru: "Loading...",
    sr: "Loading...",
    es: 'JUEGA "¡ATRAPA LA CRUZ!" Ahora configuraremos el seguimiento de la mirada para monitorear la posición de los ojos. Mantén tu rostro en el video (ver abajo). Haz clic en el centro de la cruz, donde sea que esté. Asegúrate de que tus ojos estén en ella cuando hagas clic. Cuando hagas clic, la cruz se moverá a una nueva ubicación. Haz clic en cada nueva ubicación, hasta que la calibración esté completa. Es un juego. ¡Atrapa la cruz!',
    sw: "Loading...",
    sv: "Loading...",
    tl: 'MAGLARO "HULIHIN ANG KRUS!" Ngayon ay magse-set up kami ng pagsubaybay ng tingin, upang masubaybayan ang posisyon ng mata. Panatilihin ang iyong mukha sa video feed (tingnan sa ibaba). Mag-click sa gitna ng krus, nasaan man ito. Tiyaking nakatutok dito ang iyong mga mata kapag na-click mo ito. Kapag na-click mo ito, lilipat ang krus sa isang bagong lokasyon. I-click ito sa bawat bagong lokasyon, hanggang sa matapos ang pagkakalibrate. Ito ay isang laro. Saluhin ang krus!',
    tr: "Loading...",
    ur: "Loading...",
  },
