    "zh-HK":
      "測試手機是否已連接至網路？\n1.是的，然後按一下下面的「確定」繼續。\n2. 📶 蜂窩服務：如果手機的蜂窩服務連接到互聯網，請按確定。\n3.🛜WIFI：透過Wi-Fi連接到互聯網，然後按一下「確定」。\n4. 設定時間和日期：新手機或已重設的舊手機沒有手機服務帳戶且日期錯誤。一旦您設定了時間和日期，它就會與熱點/網路共享一起工作，如下所述。\n5.熱點：如果測試手機不是您的個人手機，並且您的個人手機有互聯網，則兩部手機可以共享互聯網訪問。透過 Wi-Fi、藍牙或 USB 將手機相互連接：\n    * 🛜 Wi-Fi 熱點：如果您的個人手機透過蜂窩服務連接到互聯網，它可以為測試手機提供 Wi-Fi 熱點。連接後，按一下“確定”。\n    * >ᛒ 藍牙網路共享：如果您的個人手機使用 Wi-Fi 存取互聯網，則可以透過藍牙共享互聯網存取。在兩部手機上啟用藍牙（在 iPhone 上）或藍牙網路共享（在 Android 上），透過藍牙配對，然後按一下「確定」。\n    * USB 網路分享：如果兩部手機都是 iPhone 或兩部手機都是 Android，它們可以透過 USB 線共享網路存取（如果您有合適的線）。如今，大多數手機都使用 USB-C 連接器，但 iPhone 14 及更早版本使用 Lightning 連接器。透過適當的電纜連接電話，然後按一下「確定」。\n\n6. 沒有網路：如果這些選項都不可用，請先按一下“確定”，然後按一下“所有連線嘗試失敗”。",
