    "en-UK":
      "IS THE TEST PHONE CONNECTED TO THE INTERNET?  \n1. YES, then click OK below to proceed.  \n2. 📶 MOBILE SERVICE: If the phone’s mobile service connects to the internet, click OK.  \n3. 🛜 WIFI: Connect it to the internet via Wi-Fi and click OK.  \n4. SET TIME AND DATE: A new phone, or an old phone that's been reset, has no mobile service account and the wrong date. Once you set the time and date, it'll work with hotspot/tethering, as explained next.  \n5. HOTSPOT: If the test phone is not your personal phone, and your personal phone has internet, the two phones can share internet access. Connect the phones to each other by Wi-Fi, Bluetooth, or USB:  \n    * 🛜 Wi-Fi Hotspot: If your personal phone is connected to the internet via mobile service, it can provide a Wi-Fi hotspot to the test phone. Once connected, click OK.  \n    * >ᛒ Bluetooth Tethering: If your personal phone is using Wi-Fi for internet access, it can share the internet access via Bluetooth. Enable Bluetooth (on iPhone) or Bluetooth tethering (on Android) on both phones, pair them via Bluetooth, and click OK.  \n    * USB Tethering: If both phones are iPhones or both phones are Androids, they can share the internet access via a USB cable, if you have the right cable. Today, most phones use a USB-C connector, but the iPhone 14 and earlier use the Lightning connector. Connect the phones via the appropriate cable and click OK.  \n\n6. NO INTERNET: If none of these options are available, first click OK and then “All connection attempts failed”.",
