    id: "APAKAH TELEPON UJI TERHUBUNG KE INTERNET?\n1. YA, lalu klik OK di bawah untuk melanjutkan.\n2. 📶 LAYANAN SELULER: Jika layanan seluler telepon terhubung ke internet, klik OK.\n3. 🛜 WIFI: Hubungkan ke internet melalui Wi-Fi dan klik OK.\n4. SET WAKTU DAN TANGGAL: Telepon baru, atau telepon lama yang telah disetel ulang, tidak memiliki akun layanan seluler dan tanggalnya salah. Setelah Anda mengatur waktu dan tanggal, telepon akan berfungsi dengan hotspot/tethering, seperti yang dijelaskan selanjutnya.\n5. HOTSPOT: Jika telepon uji bukan telepon pribadi Anda, dan telepon pribadi Anda memiliki internet, kedua telepon dapat berbagi akses internet. Hubungkan telepon satu sama lain melalui Wi-Fi, Bluetooth, atau USB:\n* 🛜 Hotspot Wi-Fi: Jika telepon pribadi Anda terhubung ke internet melalui layanan seluler, telepon tersebut dapat menyediakan hotspot Wi-Fi ke telepon uji. Setelah terhubung, klik OK.\n* >ᛒ Bluetooth Tethering: Jika ponsel pribadi Anda menggunakan Wi-Fi untuk akses internet, ponsel dapat berbagi akses internet melalui Bluetooth. Aktifkan Bluetooth (pada iPhone) atau Bluetooth tethering (pada Android) pada kedua ponsel, pasangkan melalui Bluetooth, dan klik OK.\n* USB Tethering: Jika kedua ponsel adalah iPhone atau kedua ponsel adalah Android, keduanya dapat berbagi akses internet melalui kabel USB, jika Anda memiliki kabel yang tepat. Saat ini, sebagian besar ponsel menggunakan konektor USB-C, tetapi iPhone 14 dan versi sebelumnya menggunakan konektor Lightning. Hubungkan ponsel melalui kabel yang sesuai dan klik OK.\n\n6. NO INTERNET: Jika tidak ada opsi ini yang tersedia, klik OK terlebih dahulu, lalu “All connection tries failed”.",
    it: "IL TELEFONO DI TEST È CONNESSO A INTERNET?\n1. SÌ, quindi fai clic su OK qui sotto per procedere.\n2. 📶 SERVIZIO CELLULARE: Se il servizio cellulare del telefono si connette a Internet, fai clic su OK.\n3. 🛜 WIFI: Connettilo a Internet tramite Wi-Fi e fai clic su OK.\n4. IMPOSTA ORA E DATA: Un telefono nuovo o un vecchio telefono che è stato resettato non ha un account di servizio cellulare e la data errata. Una volta impostati l'ora e la data, funzionerà con hotspot/tethering, come spiegato di seguito.\n5. HOTSPOT: Se il telefono di test non è il tuo telefono personale e il tuo telefono personale ha Internet, i due telefoni possono condividere l'accesso a Internet. Connetti i telefoni tra loro tramite Wi-Fi, Bluetooth o USB:\n    * 🛜 Hotspot Wi-Fi: Se il tuo telefono personale è connesso a Internet tramite servizio cellulare, può fornire un hotspot Wi-Fi al telefono di test. Una volta connesso, fai clic su OK.\n    * >ᛒ Tethering Bluetooth: Se il tuo telefono personale utilizza il Wi-Fi per l'accesso a Internet, può condividere l'accesso a Internet tramite Bluetooth. Abilita il Bluetooth (su iPhone) o il tethering Bluetooth (su Android) su entrambi i telefoni, abbinali tramite Bluetooth e fai clic su OK.\n    * Tethering USB: Se entrambi i telefoni sono iPhone o entrambi sono Android, possono condividere l'accesso a Internet tramite un cavo USB, se hai il cavo giusto. Oggi, la maggior parte dei telefoni utilizza un connettore USB-C, ma l'iPhone 14 e precedenti utilizzano il connettore Lightning. Connetti i telefoni tramite il cavo appropriato e fai clic su OK.\n\n6. NESSUN INTERNET: Se nessuna di queste opzioni è disponibile, fai prima clic su OK e poi su “Tutti i tentativi di connessione non riusciti”.",
