    es: "¿EL TELÉFONO DE PRUEBA ESTÁ CONECTADO A INTERNET? 1. SÍ, luego haga clic en OK abajo para continuar. 2. 📶 SERVICIO CELULAR: Si el servicio celular del teléfono se conecta a internet, haga clic en OK. 3. 🛜 WIFI: Conéctelo a internet a través de Wi-Fi y haga clic en OK. 4. CONFIGURAR HORA Y FECHA: Un teléfono nuevo, o un teléfono antiguo que ha sido restablecido, no tiene cuenta de servicio celular y la fecha incorrecta. Una vez que configure la hora y la fecha, funcionará con hotspot/tethering, como se explica a continuación. 5. HOTSPOT: Si el teléfono de prueba no es su teléfono personal, y su teléfono personal tiene internet, los dos teléfonos pueden compartir acceso a internet. Conecte los teléfonos entre sí por Wi-Fi, Bluetooth o USB: * 🛜 Hotspot Wi-Fi: Si su teléfono personal está conectado a internet a través del servicio celular, puede proporcionar un hotspot Wi-Fi al teléfono de prueba. Una vez conectado, haga clic en OK. * >ᛒ Tethering por Bluetooth: Si su teléfono personal está usando Wi-Fi para acceso a internet, puede compartir el acceso a internet a través de Bluetooth. Habilite Bluetooth (en iPhone) o tethering por Bluetooth (en Android) en ambos teléfonos, emparejarlos por Bluetooth y haga clic en OK. * Tethering por USB: Si ambos teléfonos son iPhones o ambos teléfonos son Androids, pueden compartir el acceso a internet a través de un cable USB, si tiene el cable adecuado. Hoy en día, la mayoría de los teléfonos usan un conector USB-C, pero el iPhone 14 y anteriores usan el conector Lightning. Conecte los teléfonos a través del cable apropiado y haga clic en OK. 6. SIN INTERNET: Si ninguna de estas opciones está disponible, primero haga clic en OK y luego en “Todos los intentos de conexión fallaron”.",
