    hy: "Loading...",
    bg: "Loading...",
    "zh-CN": "Loading...",
    "zh-HK": "Loading...",
    hr: "Loading...",
    cs: "showMeasuredSoundLevelBool je PRAVDA v jedné nebo více podmínkách, takže k provedení těchto měření je potřeba mikrofon.\n1. PŘIPOJTE mikrofon miniDSP UMIK-1 nebo 2 k tomuto počítači.\n2. VYBERTE tento mikrofon ve vyskakovacím okně zvukového vstupu níže.\n3. VYBERTE název modelu mikrofonu, UMIK-1 nebo 2.\n4. Zadejte SÉRIOVÉ číslo a klikněte na tlačítko NAČÍST PROFIL.\n5. NASTAVTE MIKROFON\n A. Roztáhněte tři nohy stativu co nejdále. \n b. Mikrofonní klip na stativu je na otočném čepu. Otočte sponu úplně na stranu, na kterou je nejvyšší okraj spony vyšší. \n C. Zasuňte mikrofon do spony stativu zespodu, dokud nebude spodní konec mikrofonu zarovnán s nejnižším okrajem spony. \n d. Upravte sklon tak, aby byl mikrofon svislý a směřoval nahoru ke stropu. \n E. Umístěte stativ na stůl mezi vás a váš počítač. Otočením stativu přemístěte mikrofon na svou stranu. \n F. Zatlačte stativ směrem k vašemu počítači (nebo čemukoli, co má reproduktory), dokud se ho vzdálené dvě nohy stativu téměř nedotknou a třetí noha nebude blízko vás.\n6. POVOLETE POUŽÍVAT MIKROFON. Pokud vyskakovací okno požádá o povolení používat mikrofon, klikněte na „Povolit“.\n7. ⇧🔊 MAXIMÁLNÍ OBJEM. Pro přesné měření zvuku nyní maximalizujte hlasitost zvuku počítače a poté se nedotýkejte hlasitosti, dokud relace neskončí.\n8. Klikněte na POKRAČOVAT nebo stiskněte RETURN.",
