    pt: "Loading...",
    ro: "La fiecare încercare, în timp ce te uiți la cruce, un triplet de trei litere aleatoare va PLIMINĂ în colțul ochiului. Doar un fulger. Pentru a învăța sarcina, să o încercăm mai întâi cu un afișaj STATIC. Privind la cruce, dedesubt, fără să-ți miști ochii: Care este litera din mijloc?\n\n             +             B R C\n\nEste un R. Acest afișaj este static, așa că ar fi ușor să vă mutați ochii la literă și să o identificați. Dar, într-o încercare adevărată, literele sunt FLASHITE, așa că nu ai timp să-ți miști ochii. Vă rugăm să priviți crucea în timp ce începeți procesul. Nu contează unde se duc ochii după bliț. Primul bloc de testare este doar câteva încercări de practică, înainte de a începe serios. ",
    ru: "Loading...",
    sr: "На сваком суђењу, док гледате у крст, тројка од три насумична слова ће ТРПЕТИ у углу вашег ока. Само бљесак. Да бисмо научили задатак, хајде да га прво испробамо са СТАТИЧНИМ екраном. Док гледаш у крст, доле, не мрдајући очима: Које је средње слово?\n\n             +             Б Р Ц\n\nТо је Р. Овај екран је статичан, тако да би било лако померити поглед на слово и идентификовати га. Али, у правом суђењу, слова су БЉЕСНА, тако да нема времена да мрднете очима. Молим вас, погледајте крст док започињете суђење. Није важно куда ће вам очи отићи након бљеска. Први блок тестирања је само неколико покушаја у пракси, пре него што почнемо озбиљно. ",
    es: "En cada prueba, mientras miras la cruz, un trío de tres letras aleatorias DESTELLARÁ en la esquina de tu ojo. Solo un destello. Para aprender la tarea, probémoslo primero con una pantalla ESTÁTICA. Mientras miras la cruz, abajo, sin mover los ojos: ¿Cuál es la letra del medio?\n\n             +             B R C\n\nEs una R. Esta pantalla es estática, por lo que sería fácil mover los ojos hacia la letra e identificarla. Pero, en una prueba real, las letras DESTELLAN, así que no hay tiempo para mover los ojos. Por favor, mira la cruz al iniciar la prueba. No importa a dónde vayan tus ojos después del destello. El primer bloque de pruebas es solo unas pocas pruebas de práctica, antes de comenzar en serio.",
