    "en-UK":
      "On each trial, while you look at the cross, a triplet of three random digits will FLASH in the corner of your eye. Just a flash. To learn the task, let’s try it first with a STATIC display. While looking at the cross, below, without moving your eyes: What is the middle digit?\n\n             +             7 1 3\n\nIt’s 1. This display is static, so it would be easy to move your eyes to the letter and identify it. But, in a real trial, the digits are FLASHED, so there's no time to move your eyes. Please look at the cross as you initiate the trial. It doesn't matter where your eyes go after the flash. The first block of testing is just a few trials of practice, before we start in earnest.",
    fi: "Loading...",
    fr: "À chaque essai, pendant que vous regardez la croix, un triplet de trois chiffres aléatoires CLIGNOTERA dans le coin de votre œil. Juste un éclair. Pour apprendre la tâche, essayons d'abord avec un affichage STATIQUE. En regardant la croix, ci-dessous, sans bouger les yeux : Quel est le chiffre du milieu ?\n\n             +             7 1 3\n\nC'est 1. Cet affichage est statique, donc il serait facile de déplacer vos yeux vers la lettre et de l'identifier. Mais, dans un essai réel, les chiffres sont CLIGNOTÉS, donc il n'y a pas de temps pour déplacer vos yeux. Veuillez regarder la croix lorsque vous commencez l'essai. Peu importe où vont vos yeux après le flash. Le premier bloc de test est juste quelques essais de pratique, avant que nous commencions sérieusement.",
    de: "Loading...",
    el: "Σε κάθε δοκιμή, ενώ κοιτάτε τον σταυρό, μια τριπλέτα τριών τυχαίων ψηφίων θα ΛΑΒΕΙ στην άκρη του ματιού σας. Μόνο ένα φλας. Για να μάθετε την εργασία, ας τη δοκιμάσουμε πρώτα με μια STATIC οθόνη. Κοιτάζοντας τον σταυρό, κάτω, χωρίς να κουνάτε τα μάτια σας: Ποιο είναι το μεσαίο ψηφίο;\n\n             +             7 1 3\n\nΕίναι 1. Αυτή η οθόνη είναι στατική, επομένως θα ήταν εύκολο να μετακινήσετε τα μάτια σας στο γράμμα και να το αναγνωρίσετε. Όμως, σε μια πραγματική δοκιμή, τα ψηφία αναβοσβήνουν, οπότε δεν υπάρχει χρόνος να κινήσετε τα μάτια σας. Παρακαλώ κοιτάξτε τον σταυρό καθώς ξεκινάτε τη δίκη. Δεν έχει σημασία πού πάνε τα μάτια σου μετά το φλας. Το πρώτο μπλοκ δοκιμών είναι μόνο μερικές δοκιμές εξάσκησης, προτού ξεκινήσουμε σοβαρά. ",
    he: "Loading...",
    hi: "Loading...",
    hu: "Minden egyes próbánál, miközben a keresztre néz, egy három véletlenszerű számjegyből álló hármas VILLOG a szeme sarkában. Csak egy villanás. A feladat megtanulásához először próbáljuk ki STATIC kijelzővel. Miközben a keresztre néz, lent, anélkül, hogy a szemét mozgatná: Mi a középső számjegy?\n\n             +             7 1 3\n\nEz az 1. Ez a kijelző statikus, így könnyű lenne a szemét a betűre mozgatni és azonosítani. De egy igazi próba során a számjegyek VILLOGNAK, így nincs idő mozgatni a szemét. Kérem, nézze meg a keresztet, amikor elindítja a tárgyalást. Nem mindegy, hogy a vaku után hova kerül a szemed. A tesztelés első blokkja csak néhány gyakorlati próba, mielőtt komolyan elkezdenénk. ",
    is: "Loading...",
    id: "Loading...",
    it: "In ogni prova, mentre guardi la croce, un terzetto di tre cifre casuali LAMPEGGERÀ nell'angolo del tuo occhio. Solo un lampo. Per imparare il compito, proviamo prima con un display STATICO. Mentre guardi la croce, qui sotto, senza muovere gli occhi: Qual è la cifra centrale?\n\n             +             7 1 3\n\nÈ 1. Questo display è statico, quindi sarebbe facile muovere gli occhi verso la lettera e identificarla. Ma, in una prova reale, le cifre LAMPEGGIANO, quindi non c'è tempo per muovere gli occhi. Per favore, guarda la croce mentre inizi la prova. Non importa dove vanno i tuoi occhi dopo il lampo. Il primo blocco di test è solo alcune prove di pratica, prima di iniziare sul serio.",
