    es: "En cada prueba, mientras miras la cruz, un trío de tres dígitos aleatorios DESTELLARÁ en el rincón de tu ojo. Solo un destello. Para aprender la tarea, probémoslo primero con una pantalla ESTÁTICA. Mientras miras la cruz, abajo, sin mover los ojos: ¿Cuál es el dígito del medio?\n\n             +             7 1 3\n\nEs 1. Esta pantalla es estática, por lo que sería fácil mover los ojos hacia la letra e identificarla. Pero, en una prueba real, los dígitos DESTELLAN, así que no hay tiempo para mover los ojos. Por favor, mira la cruz al iniciar la prueba. No importa a dónde vayan tus ojos después del destello. El primer bloque de pruebas es solo unas pocas pruebas de práctica, antes de comenzar en serio.",
    sw: "Loading...",
    sv: "Vid varje försök, medan du tittar på korset, blinkar en trilling med tre slumpmässiga siffror i ögonvrån. Bara en blixt. För att lära oss uppgiften, låt oss prova den först med en STATISK display. Medan du tittar på korset, nedanför, utan att röra ögonen: Vad är mittsiffran?\n\n             +              7 1 3\n\nDet är 1. Den här displayen är statisk, så det skulle vara lätt att flytta ögonen till bokstaven och identifiera den. Men i en riktig rättegång blinkar siffrorna, så det finns ingen tid att röra ögonen. Titta på korset när du inleder rättegången. Det spelar ingen roll vart dina ögon tar vägen efter blixten. Det första testblocket är bara några övningar innan vi börjar på allvar. ",
