    es: "En cada prueba, mientras miras la cruz, una letra aleatoria DESTELLARÁ en la esquina de tu ojo. Solo un destello. Para aprender la tarea, probémoslo primero con una pantalla ESTÁTICA. Mientras miras la cruz, abajo, sin mover los ojos: ¿Qué letra es?\n\n             +               R \n\nEs una R. Esta pantalla es estática, por lo que sería fácil mover los ojos hacia la letra e identificarla. Pero, en una prueba real, la letra DESTELLA, así que no hay tiempo para mover los ojos. Por favor, mira la cruz al iniciar la prueba. No importa a dónde vayan tus ojos después del destello. El primer bloque de pruebas es solo unas pocas pruebas de práctica, antes de comenzar en serio.",
