    it: "In ogni prova, mentre guardi la croce, una cifra casuale LAMPEGGERÀ nell'angolo del tuo occhio. Solo un lampo. Per imparare il compito, proviamolo prima con un display STATICO. Mentre guardi la croce, qui sotto, senza muovere gli occhi: Qual è la cifra?\n\n             +               3  \n\nÈ 3. Questo display è statico, quindi sarebbe facile muovere gli occhi verso la cifra e identificarla. Ma, in una prova reale, la cifra LAMPEGGIA, quindi non c'è tempo per muovere gli occhi. Per favore, guarda la croce mentre inizi la prova. Non importa dove vanno i tuoi occhi dopo il lampo. Il primo blocco di test è solo alcune prove di pratica, prima di iniziare sul serio.",
    ja: "Loading...",
    kn: "ಪ್ರತಿ ಪ್ರಯೋಗದಲ್ಲಿ, ನೀವು ಶಿಲುಬೆಯನ್ನು ನೋಡುವಾಗ, ನಿಮ್ಮ ಕಣ್ಣಿನ ಮೂಲೆಯಲ್ಲಿ ಯಾದೃಚ್ಛಿಕ ಅಂಕೆಯು ಫ್ಲ್ಯಾಶ್ ಆಗುತ್ತದೆ. ಕೇವಲ ಒಂದು ಫ್ಲಾಶ್. ಕೆಲಸವನ್ನು ಕಲಿಯಲು, STATIC ಡಿಸ್ಪ್ಲೇನೊಂದಿಗೆ ಅದನ್ನು ಮೊದಲು ಪ್ರಯತ್ನಿಸೋಣ. ಶಿಲುಬೆಯನ್ನು ನೋಡುವಾಗ, ಕೆಳಗೆ, ನಿಮ್ಮ ಕಣ್ಣುಗಳನ್ನು ಚಲಿಸದೆ: ಅದು ಯಾವ ಅಂಕೆ?\n\n             +              3  \n\nಇದು 3. ಈ ಪ್ರದರ್ಶನವು ಸ್ಥಿರವಾಗಿದೆ, ಆದ್ದರಿಂದ ನಿಮ್ಮ ಕಣ್ಣುಗಳನ್ನು ಅಂಕೆಗೆ ಸರಿಸಲು ಮತ್ತು ಅದನ್ನು ಗುರುತಿಸಲು ಸುಲಭವಾಗುತ್ತದೆ. ಆದರೆ, ನಿಜವಾದ ಪ್ರಯೋಗದಲ್ಲಿ, ಅಂಕೆಯು ಫ್ಲ್ಯಾಶ್ ಆಗಿದೆ, ಆದ್ದರಿಂದ ನಿಮ್ಮ ಕಣ್ಣುಗಳನ್ನು ಸರಿಸಲು ಸಮಯವಿಲ್ಲ. ನೀವು ಪ್ರಯೋಗವನ್ನು ಪ್ರಾರಂಭಿಸುವಾಗ ದಯವಿಟ್ಟು ಶಿಲುಬೆಯನ್ನು ನೋಡಿ. ಫ್ಲ್ಯಾಷ್ ನಂತರ ನಿಮ್ಮ ಕಣ್ಣುಗಳು ಎಲ್ಲಿಗೆ ಹೋಗುತ್ತವೆ ಎಂಬುದು ಮುಖ್ಯವಲ್ಲ. ಪರೀಕ್ಷೆಯ ಮೊದಲ ಬ್ಲಾಕ್ ಅಭ್ಯಾಸದ ಕೆಲವು ಪ್ರಯೋಗಗಳು, ನಾವು ಶ್ರದ್ಧೆಯಿಂದ ಪ್ರಾರಂಭಿಸುವ ಮೊದಲು.",
    ko: "영어: 각 시행에서 십자가를 보는 동안 눈꼬치에 무작위 숫자가 깜빡입니다. 그냥 깜빡입니다. 작업을 배우려면 먼저 정적 디스플레이로 시도해 보겠습니다. 눈을 움직이지 않고 아래의 십자가를 보면서: 무슨 숫자일까요?\n\n              +                3  \n\n3입니다. 이 디스플레이는 정적이므로 눈을 숫자로 옮겨 식별하기 쉽습니다. 하지만 실제 시행에서는 숫자가 깜빡이므로 눈을 움직일 시간이 없습니다. 시행을 시작할 때 십자가를 보세요. 깜빡임 후 눈이 어디로 가는지는 중요하지 않습니다. 첫 번째 테스트 블록은 본격적으로 시작하기 전에 몇 번의 연습 시행일 뿐입니다.",
    lt: "Kiekvieno bandymo metu, kai žiūrite į kryžių, jūsų akies kamputyje mirksės atsitiktinis skaitmuo. Tiesiog blyksnis. Norėdami išmokti užduotį, pirmiausia išbandykite ją naudodami STATIC ekraną. Žiūrint į kryžių, apačioje, nepajudinant akių: koks tai skaitmuo?\n\n             +               3  \n\nTai yra 3. Šis ekranas yra statinis, todėl būtų lengva nukreipti akis į skaitmenį ir jį atpažinti. Tačiau tikrame bandyme skaitmuo mirksėja, todėl nėra laiko pajudinti akių. Pradėdami teismą, pažiūrėkite į kryžių. Nesvarbu, kur krypsta akys po blykstės. Pirmasis bandymų blokas yra tik keli praktikos bandymai, prieš pradedant rimtai.",
