    ar: 'كشف الصوت\n\nستكمل عدة تجارب. في كل تجربة، قد تسمع أو لا تسمع صوت الهدف: نغمة واحدة تتكرر 8 مرات. نصف التجارب تتضمن صوت الهدف، والنصف الآخر لا يتضمنه.\n\nمهمتك: بعد الاستماع، اضغط على "y" إذا سمعت صوت الهدف، أو "n" إذا لم تسمعه. سيتم ضبط مستوى الصوت أثناء تقدمك، مما يجعل الهدف بالكاد يمكن اكتشافه.\n\nفي كتلة التدريب، سيكون الهدف وحده. لاحقًا، ستلعب أصوات أخرى أيضًا - تجاهلها وركز فقط على اكتشاف الهدف.\n\nاضغط على RETURN أو انقر على PROCEED.',
