    nl: "Loading...",
    "en-UK":
      "SOUND DETECTION\n\nYou will complete several trials. In each trial, you may or may not hear a target sound: one note repeated 8 times. Half of the trials include the target sound, and half do not.\n\nYour task: After listening, press “y” if you heard the target sound, or “n” if you did not. The volume will adjust as you go, making the target barely detectable.\n\nIn the practice block, the target will be alone. Later, other sounds will play too—ignore them and focus only on detecting the target.\n\nHit RETURN or click PROCEED.",
    fi: "Loading...",
    fr: "DÉTECTION DU SON\n\nVous effectuerez plusieurs essais. Dans chaque essai, vous pouvez entendre ou non un son cible : une note répétée 8 fois. La moitié des essais incluent le son cible, et l'autre moitié non.\n\nVotre tâche : Après avoir écouté, appuyez sur \"y\" si vous avez entendu le son cible, ou sur \"n\" si vous ne l'avez pas entendu. Le volume s'ajustera au fur et à mesure, rendant la cible à peine détectable.\n\nDans le bloc d'entraînement, la cible sera seule. Plus tard, d'autres sons seront également joués—ignorez-les et concentrez-vous uniquement sur la détection de la cible.\n\nAppuyez sur RETOUR ou cliquez sur PROCÉDER.",
    de: "Loading...",
    el: "Loading...",
    he: 'זיהוי קול\n\nאתה תסיים מספר ניסויים. בכל ניסוי, אולי תשמע או לא תשמע צליל מטרה: צליל אחד שחוזר על עצמו 8 פעמים. מחצית מהניסויים כוללים את צליל המטרה, ומחציתם לא.\n\nהמשימה שלך: לאחר האזנה, לחץ על "y" אם שמעתם את צליל היעד, או "n" אם לא שמעתם. עוצמת הקול יתכוונן תוך כדי, מה שהופך את המטרה בקושי לזיהוי.\n\nבבלוק התרגול, המטרה תהיה לבד. מאוחר יותר, גם צלילים אחרים יתנגנו - התעלם מהם והתמקד רק בזיהוי המטרה.\n\nלחץ על חזור או לחץ על המשך. ',
    hi: "Loading...",
