    is: "Loading...",
    id: "Loading...",
    it: 'RILEVAMENTO DEL SUONO\n\nCompleterai diverse prove. In ogni prova, potresti sentire o meno un suono bersaglio: una nota ripetuta 8 volte. La metà delle prove include il suono bersaglio, l\'altra metà no.\n\nIl tuo compito: Dopo aver ascoltato, premi "y" se hai sentito il suono bersaglio, o "n" se non l\'hai sentito. Il volume si regolerà man mano, rendendo il bersaglio appena rilevabile.\n\nNel blocco di pratica, il bersaglio sarà da solo. Successivamente, suoneranno anche altri suoni—ignorali e concentrati solo sul rilevamento del bersaglio.\n\nPremi INVIO o fai clic su PROSEGUI.',
    ja: "Loading...",
    kn: 'ಸೌಂಡ್ ಡಿಟೆಕ್ಷನ್\n\nನೀವು ಹಲವಾರು ಪ್ರಯೋಗಗಳನ್ನು ಪೂರ್ಣಗೊಳಿಸುತ್ತೀರಿ. ಪ್ರತಿ ಪ್ರಯೋಗದಲ್ಲಿ, ನೀವು ಗುರಿಯ ಧ್ವನಿಯನ್ನು ಕೇಳಬಹುದು ಅಥವಾ ಕೇಳದೇ ಇರಬಹುದು: ಒಂದು ಟಿಪ್ಪಣಿಯನ್ನು 8 ಬಾರಿ ಪುನರಾವರ್ತಿಸಲಾಗುತ್ತದೆ. ಅರ್ಧದಷ್ಟು ಪ್ರಯೋಗಗಳು ಗುರಿಯ ಧ್ವನಿಯನ್ನು ಒಳಗೊಂಡಿರುತ್ತವೆ ಮತ್ತು ಅರ್ಧದಷ್ಟು ಇಲ್ಲ.\n\nನಿಮ್ಮ ಕಾರ್ಯ: ಆಲಿಸಿದ ನಂತರ, ನೀವು ಗುರಿಯ ಧ್ವನಿಯನ್ನು ಕೇಳಿದರೆ "y" ಅಥವಾ ನೀವು ಕೇಳದಿದ್ದರೆ "n" ಒತ್ತಿರಿ. ನೀವು ಹೋದಂತೆ ವಾಲ್ಯೂಮ್ ಸರಿಹೊಂದಿಸುತ್ತದೆ, ಗುರಿಯನ್ನು ಕಂಡುಹಿಡಿಯಲಾಗುವುದಿಲ್ಲ.\n\nಅಭ್ಯಾಸ ಬ್ಲಾಕ್‌ನಲ್ಲಿ, ಗುರಿ ಏಕಾಂಗಿಯಾಗಿರುತ್ತಾನೆ. ನಂತರ, ಇತರ ಶಬ್ದಗಳು ಸಹ ಪ್ಲೇ ಆಗುತ್ತವೆ-ಅವುಗಳನ್ನು ನಿರ್ಲಕ್ಷಿಸಿ ಮತ್ತು ಗುರಿಯನ್ನು ಪತ್ತೆಹಚ್ಚುವಲ್ಲಿ ಮಾತ್ರ ಕೇಂದ್ರೀಕರಿಸುತ್ತವೆ.\n\nಹಿಂತಿರುಗಿ ಒತ್ತಿರಿ ಅಥವಾ ಮುಂದುವರೆಯಿರಿ ಕ್ಲಿಕ್ ಮಾಡಿ. ',
    ko: '소리 감지\n\n여러 번의 연습을 완료하게 됩니다. 각 연습에서 목표 소리가 들릴 수도 있고 들리지 않을 수도 있습니다. 한 음이 8번 반복됩니다. 연습의 절반에는 목표 소리가 포함되고, 나머지 절반에는 포함되지 않습니다.\n\n과제: 소리를 들은 후, 목표 소리가 들리면 "y"를, 들리지 않으면 "n"을 누르세요. 볼륨은 연습이 진행됨에 따라 조절되어 목표 소리를 거의 감지할 수 없게 됩니다.\n\n연습 블록에서는 목표 소리가 혼자 재생됩니다. 나중에 다른 소리도 재생됩니다. 다른 소리는 무시하고 목표 소리를 감지하는 데만 집중하세요.\n\nRETURN 키를 누르거나 PROCEED를 클릭하세요.',
